INSERT INTO `SiteTree` VALUES (284,'Page','2010-09-26 02:12:01','2014-03-20 10:40:54','rubber-tracks','Rubber Tracks',NULL,'<h1 style=\"font-weight:bold; text-align:center; text-decoration:underline;\">Rubber Tracks For Mini Excavators<br /></h1>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;<img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage201134-Rubber-tracks1c580fab.jpg\" width=\"201\" height=\"134\" alt=\"\" title=\"\" /></td>\r\n<td>\r\n<p><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage201137-timthumb.jpg\" width=\"201\" height=\"137\" alt=\"\" title=\"\" /></p>\r\n</td>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage183132-RubberTracksForExcavatorsCarriersDumpersHarvesters.jpg\" width=\"183\" height=\"132\" alt=\"\" title=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p style=\"text-align:center; font-size:13pt; font-weight:bold; line-height:18pt;\"><span style=\"text-decoration: underline;\">NZ Freephone:</span> 0800 551 201<br /><span style=\"text-decoration: underline;\">Email:</span> <a href=\"mailto:rubbertrack@mainlinecom.co.nz\">rubbertrack@mainlinecom.co.nz </a><br /><span style=\"text-decoration: underline;\">Rubber Track Manager:</span> Jason Smith</p>\r\n<p style=\"text-align: center; \"><strong><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: red; \"><span style=\"font-size: small;\">Great range in stock now &amp; ready for immediate dispatch - CALL NOW</span></span></span></strong></p>\r\n<p><strong>Mainline Track</strong> are the New Zealand Rubber Track suppliers, we are well placed to fulfill all your requirements quickly, efficiently and cost effectively. With rubber tracks in stock from 180mm wide to 450mm wide to fit around 3000 models of excavators, power barrows, tracked dumpers and other tracked equipment, we can virtually guarantee stock availability on any machine.</p>\r\n<p>Our quality proven tracks are manufactured in an ISO9001 approved factory using the continuous steel cord method and are guaranteed to perform.</p>\r\n<p>We understand that downtime is money and offer a delivery service second to none &ndash;Next day to most main centers in NZ.</p>\r\n<h4 class=\"txtleft\">Freight</h4>\r\n<p>Next day delivery to main centres of the South Island. Two day service to most of North Island.</p>\r\n<h4 class=\"txtleft\">Range of Stock</h4>\r\n<p>We are still in the process of building up a good stock. We currently have over 60 different sizes in stock fitting hundreds of excavators. Please enquire today to see if we currently have your size in stock.</p>\r\n<p>&nbsp;</p>\r\n<h4 class=\"txtleft\">Measuring guides available to ensure correct track size</h4>\r\n<p>See below for link to download our track measurement guide. Please provide the necessary dimensions to help us determine your track size.</p>\r\n<p style=\"font-size:20pt; color:#c00;\"><a href=\"get-quote/\" title=\"Click Here For Quotation\">Click Here for Quotation &raquo;</a></p>\r\n<p><a href=\"assets/Uploads/Mainline-Track-Info/Measurement-Guide.pdf\" target=\"_blank\" title=\"Measurement Guides\"><strong>Click Here To Download Measurement Guide</strong></a></p>\r\n<p><a href=\"assets/Mainline-Track/track-fitting.pdf\" target=\"_blank\" title=\"Fitt Guide\"><strong>Track Tensioning Guide </strong></a></p>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage163172-Darker-One.JPG\" width=\"163\" height=\"172\" alt=\"\" title=\"\" />&nbsp;&nbsp;</td>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage222168-P1010009.JPG\" width=\"222\" height=\"168\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage232167-P1010055.JPG\" width=\"232\" height=\"167\" alt=\"\" title=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>','Mainline Track - Rubber Tracks',NULL,NULL,NULL,1,1,NULL,0,2,NULL,1,0,'Published',NULL,'Inherit','Inherit',NULL,289,168,1,0,NULL),(603,'Page','2012-12-18 15:02:35','2012-12-18 15:04:10','links','Links',NULL,'<h1>Websites we like</h1>\n<ul class=\"bullets\">\n<li><strong><a href=\"http://www.mainlinecommercials.co.nz/\" target=\"_blank\">Mainline Commercials</a></strong> - DEALERS IN TRUCKS AND EARTHMOVING EQUIPMENT</li>\n</ul>','Links',NULL,NULL,NULL,0,1,NULL,0,1,NULL,0,0,'Published',NULL,'Inherit','Inherit',NULL,602,3,1,0,NULL),(292,'UsedEquipmentHolder','2010-10-07 08:06:54','2014-03-20 10:41:59','used-attachments','Used Attachments',NULL,'<p>&nbsp;</p>\n<p>See our range of Hitches &amp; Buckets we have available. Call or email us today.</p>','Mainline Track - Buckets, Hitches, Hydraulic Rams, Steel Wraps','See our range of Hitches & Buckets we have available.','Buckets, Hitches, Hydraulic Rams, Steel Wraps',NULL,1,1,NULL,0,6,NULL,0,0,'Published',NULL,'Inherit','Inherit',NULL,289,19,1,0,NULL),(293,'Page','2010-10-07 08:07:15','2014-03-20 10:40:54','under-carriage-parts','Under Carriage Parts',NULL,'<h1 style=\"font-weight:bold; text-align:center; text-decoration:underline;\">\r\n<table border=\"0\" style=\"height: 200px; width: 651px;\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage186136-1475503694e1ad4673e629.jpg\" width=\"186\" height=\"136\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage219133-excavator-bulldozer-track-roller-bottom-roller-lower-roller.jpg\" width=\"219\" height=\"133\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"leftAlone\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage201153-excavator-hd-sp1rocket.jpg\" wi