/div>\r\n<ul class=\"bullets\">\r\n<li>Heavy Duty hanger brackets</li>\r\n<li>Weld on teeth</li>\r\n<li>Wear strips</li>\r\n<li>Hard wearing edges</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4 class=\"txtleft\">Special Orders include</h4>\r\n<div style=\"background:#FF9; border:1px solid #CEC509; padding:10px; font-weight:bold; text-align:center;\">At Mainline Track we also offer Tuff Buckets manufactured to meet our<br />customers specific requirements.</div>\r\n<li>Clay Buckets</li>\r\n<li>Riddle Buckets</li>\r\n<li>Heavy Duty telehandler buckets</li>\r\n<li>Heavier duty bucket sides</li>\r\n<p><br /><br />We also offer a freight service NZ wide so where ever you are in the country we can get it to your door. There\'s usually about a 1 week lead time from the time of order/payment.</p>\r\n<p style=\"font-size:13pt; text-align:center;\"><span style=\"color:#c00;\"><strong>Enquire/Get a Quote Now:</strong> </span><a href=\"get-quote/\">Click Here &raquo;</a></p>','Excavator Attachments',NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Inherit','Inherit',NULL,289,165,1,0,NULL),(556,'Page','2012-08-05 23:34:12','2014-03-20 10:40:54','morooka-tracks','MOROOKA TRACKS',NULL,'<p><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\"><img class=\"center\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage275253-EngineeringRubberTrack.jpg\" width=\"275\" height=\"253\" alt=\"\" title=\"\" /></span></span><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\"><br /></span></span></p>\r\n<p  style=\"text-align: center; margin: 0cm 0cm 0pt;\"><em><span style=\"text-decoration: underline;\"><span style=\"font-size: 12pt; mso-bidi-font-family: Calibri; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;\">Our Tuff-trac Morooka tracks come with a 6 month or 500 hour warranty.</span></span></em><br /><br /><br /><br /><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Ca