xt day delivery to main centres of the South Island.<span style=\"mso-spacerun: yes;\">&nbsp; </span>Two day service to most of North Island<br /><br /><br /></strong><span style=\"text-decoration: underline;\"><span style=\"color: #0066cc;\"><a href=\"get-quote/\" title=\"Application Form\"><span style=\"text-decoration: underline;\"><span style=\"color: #0066cc;\">Click Here For Quotation</span></span></a></span></span><br /><span style=\"text-decoration: underline;\"><span style=\"color: #0066cc;\"><a href=\"assets/Mainline-Track/Account-Application.pdf\" target=\"_blank\" title=\"Application Form\"><span style=\"text-decoration: underline;\"><span style=\"color: #0066cc;\">Click Here To Download Account Application Form</span></span></a></span></span></span></span></p>','Mainline Track - Home','Top quality, efficient, friendly service. Quality rubber tracks at competitive prices backed up by an excellent manufacturers warranty and a large range of suppliers.','rubber tracks, rubber pads, Morooka, tracks, rubber, excavator parts','<meta name=\"nzs-verify\" content=\"CLAIM-509877d7062f0\" />',1,1,NULL,0,1,NULL,0,0,'Published',NULL,'Inherit','Inherit',NULL,0,499,1,0,NULL),(280,'Page','2010-09-24 02:31:18','2014-03-20 10:42:27','about-us-track','About Us','ABOUT US','<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span><span style=\"color: #000000;\"><span><span style=\"color: #000000;\"><span><span style=\"text-decoration: underline;\"><strong><br /><img class=\"center\" src=\"assets/image-gallery/Photo-Gallery/mainline-track-premises/_resampled/ResizedImage600450-IMG1478.jpg\" width=\"600\" height=\"450\" alt=\"\" title=\"\" /><br /><br />Mainline Track</strong></span> is your only Tuff Part supplier in New Zealand for small to medium sized earthmoving machinery. We are a 100% NZ owned and operated company centrally located in Nelson. In late 2009 we started off selling a few second hand rubber tracks and a small range of new sizes. From there demand has continued to grow and we&rsquo;ve since picked up a very reliable supplier which is supplying us with top quality products which we are now selling all over New Zealand and up into the Pacific Islands. We now have numerous amounts of happy and repeat customers.</span></span></span></span><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><br /></span></span></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">In November 2012 Mainline Track opened its doors to a new premises and head office at 20A Poutama Street. The new building is the warehouse for the rubber tracks, excavator buckets and mini undercarriage parts. The well set up facility has a range of offices, a MAF approved transitional facility, plenty of parking for customers and space to load and unload trucks.</span></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">Product quality is top priority at <em><span style=\"font-family: Arial;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span style=\"text-decoration: underline;\"><a href=\"http://www.mainlinetrack.co.nz/\"><em><span style=\"font-family: Arial;\"><span style=\"font-family: \'Arial\',\'sans-serif\';\"><span style=\"text-decoration: underline;\">Mainline Track</span></span></span></em></a></span></span></span></em>. All our products are sourced from reputable companies worldwide, many of whom supply new excavator manufacturers. From our well stocked warehouse we are able to deliver anywhere in NZ, enabling our customers to have their machines ready for work with minimum delay and downtime.</span></span></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">We believe that technical support and product knowledge are our company\'s greatest strengths. With over 40 years&rsquo; experience in the earthmoving industry, you can be confident that our sales staff will advise which product is best suited to your requirements so that your machine can be returned to work without delay or undue expense.</span></span></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">If the parts you require are not in stock, we go to great lengths to find these parts for you. With many contacts in Australia and further afield, we can source parts we don&rsquo;t usually stock. This not only reduces the downtime of your machine, but gives you the confidence to rely on us as a one-stop-shop for all your mini excavator parts.</span></span></span></span></p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span style=\"color: #000000;\">&ldquo;<span style=\"font-family: Arial;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">Our Mission&rdquo;</span></span> is to provide efficient personal service supplying quality products at competitive prices, supported by expert technical advice. We will continue to strengthen our reputation which is built on honesty, integrity &amp; excellent service&rdquo;<br /><br /><br /><span style=\"text-decoration: underline;\"><em>See below our current brochures:</em></span></span></span></span></span><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span style=\"color: #000000;\"><br /></span></span></span></span>\r\n<p style=\"line-height: 14.25pt; margin: 0cm 0cm 13.5pt; background: white;\"><br /><a href=\"assets/Uploads/Mainline-Track-Info/MainlineTrack-Leaflet.zip\" target=\"_blank\">Mainline Track Leaflet:</a></p>\r\n<p><a href=\"assets/Uploads/Mainline-Track-Info/Mainline-Track-Product-Cata.pdf\" target=\"_blank\">Mainline Product Catalogue:</a></p>\r\n<p>&nbsp;</p>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage158121-excavator-hd-sp1rocket.jpg\" width=\"158\" height=\"121\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"left\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage159117-Rubber-tracks1c580fab.jpg\" width=\"159\" height=\"117\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"left\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage166123-track-roller-undercarriage-parts-excavator-parts.jpg\" width=\"166\" height=\"123\" alt=\"\" title=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</h2>','About Mainline Track','We be