text-decoration: underline;\"><em>Rubber bolt-on Pads.</em></span><br /></span></h2>\r\n<p style=\"margin: 0cm 0cm 0pt;\">&nbsp;</p>\r\n<p style=\"BACKGROUND: white; TEXT-ALIGN: center; MARGIN: 0cm 0cm 15.05pt; LINE-HEIGHT: 15.9pt\"><strong><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\"><img class=\"center\" src=\"assets/Mainline-Track/_resampled/ResizedImage200100-lv2.jpg\" width=\"200\" height=\"100\" alt=\"\" title=\"\" /><br /></span></strong></p>\r\n<div style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\"><span>\r\n<p style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\">&nbsp;</p>\r\n<p style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\">Mainline Track are the New Zealand Rubber Track suppliers, we are well placed to fulfill all your requirements quickly, efficiently and cost effectively. We have a range &nbsp;rubber pads in stock from 400mm wide to 600mm wide to fit around 200 models of excavators, all available for immediate dispatch.</p>\r\n</span></div>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #2f2f2f; mso-ansi-language: EN;\">Bolt-On rubber pads are an ideal option where the steel track shoes are pre-drilled, as is becoming more popular in today&rsquo;s market.&nbsp; The benefit is the strength the steel shoe is retained, and the pad has a lower profile, with no clips overhanging the steel shoe.&nbsp; These pads are available to suit machines from 4 to 21 ton.</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\"><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\"><span style=\"font-family: Arial;\">&nbsp;</span></span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 13.4pt; line-height: 15.05pt;\"><span style=\"font-size: 13.5pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\"><span style=\"text-decoration: underline;\">Freight</span></span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\"><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\">Next day delivery to main centres of the South Island. Two day service to most of North Island.</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 13.4pt; line-height: 15.05pt;\"><span style=\"font-size: 13.5pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\"><span style=\"font-family: Arial;\">&nbsp;</span></span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 13.4pt; line-height: 15.05pt;\"><span style=\"font-size: 13.5pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\"><span style=\"text-decoration: underline;\">Range of Stock</span></span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\"><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\">We are still in the process of building up our range of pads. Please enquire today to see if we currently have your pad in stock.</span></p>\r\n<p style=\"background: white; margin: 0cm 0cm 15.05pt; line-height: 15.9pt;\"><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\"><span style=\"font-family: Arial;\">&nbsp;</span></span><span style=\"font-size: 10pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; color: #222222; mso-ansi-language: EN-US;\">Critical information required when ordering.</span></p>\r\n<p style=\"margin: 0cm 0cm 0pt 36pt; text-indent: -18pt; mso-list: l0 level1 lfo1;\"><span style=\"font-size: 1