INSERT INTO `SiteTree_Live` VALUES (724,'ErrorPage','2014-03-19 20:30:34','2014-03-19 20:30:34','server-error','Server error',NULL,'<p>Sorry, there was a problem with handling your request.</p>',NULL,NULL,NULL,NULL,0,0,NULL,0,17,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,0,1,0,0,NULL),(725,'ErrorPage','2014-03-20 10:38:54','2014-03-20 10:38:54','server-error-2','Server error',NULL,'<p>Sorry, there was a problem with handling your request.</p>',NULL,NULL,NULL,NULL,0,0,NULL,0,17,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,0,1,0,0,NULL),(526,'Page','2012-04-05 04:14:23','2014-03-20 10:40:54','excavator-attachments','Excavator Attachments',NULL,'<h1 style=\"font-weight:bold; text-align:center; text-decoration:underline;\">Excavator Attachments</h1>\r\n<table border=\"0\" style=\"margin:0 auto;\">\r\n<tbody>\r\n<tr>\r\n<td><img src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage213153-imagetuffBucket.png\" width=\"213\" height=\"153\" alt=\"\" title=\"\" /></td>\r\n<td><img src=\"assets/Uploads/Mainline-Track-Info/excavator-attachments.jpg\" alt=\"Excavator Attachments\" title=\"Excavator Attachments\" width=\"360\" height=\"176\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p align=\"center\" style=\"font-size:13pt; font-weight:bold;\"><span style=\"text-decoration: underline;\">1-8 Tonne Excavator Buckets &amp; Rippers</span> - <span style=\"color:#c00\">IN STOCK</span></p>\r\n<ul class=\"bullets txt13\">\r\n<li>Cleaning</li>\r\n<li>Digging</li>\r\n<li>Trenching</li>\r\n<li>Rippers</li>\r\n</ul>\r\n<p>The Tuff-bucket range of Excavator Buckets have been designed and developed with the user in mind. This exclusive range are manufactured to a high specification using superior grade wear resistant steel to maximise wear life, even in the most adverse working conditions.</p>\r\n<h4 class=\"txtleft\">Tuff Bucket Features</h4>\r\n<div style=\"background:#FF9; border:1px solid #CEC509; padding:10px; font-weight:bold; text-align:center;\">In addition to standard Tuff-buckets, we can order buckets to suit customer&rsquo;s requirements.</div>\r\n<ul class=\"bullets\">\r\n<li>Heavy Duty hanger brackets</li>\r\n<li>Weld on teeth</li>\r\n<li>Wear strips</li>\r\n<li>Hard wearing edges</li>\r\n</ul>\r\n<p>&nbsp;</p>\r\n<h4 class=\"txtleft\">Special Orders include</h4>\r\n<div style=\"background:#FF9; border:1px solid #CEC509; padding:10px; font-weight:bold; text-align:center;\">At Mainline Track we also offer Tuff Buckets manufactured to meet our<br />customers specific requirements.</div>\r\n<li>Clay Buckets</li>\r\n<li>Riddle Buckets</li>\r\n<li>Heavy Duty telehandler buckets</li>\r\n<li>Heavier duty bucket sides</li>\r\n<p><br /><br />We also offer a freight service NZ wide so where ever you are in the country we can get it to your door. There\'s usually about a 1 week lead time from the time of order/payment.</p>\r\n<p style=\"font-size:13pt; text-align:center;\"><span style=\"color:#c00;\"><strong>Enquire/Get a Quote Now:</strong> </span><a href=\"get-quote/\">Click Here &raquo;</a></p>',NULL,NULL,NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,289,165,0,0,NULL),(556,'Page','2012-08-05 23:34:12','2014-03-20 10:40:54','morooka-tracks','MOROOKA TRACKS',NULL,'<p><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\"><img class=\"center\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage275253-EngineeringRubberTrack.jpg\" width=\"275\" height=\"253\" alt=\"\" title=\"\" /></span></span><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\"><br /></span></span></p>\r\n<p  style=\"text-align: center; margin: 0cm 0cm 0pt;\"><em><span style=\"text-decoration: underline;\"><span style=\"font-size: 12pt; mso-bidi-font-family: Calibri; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;\">Our Tuff-trac Morooka tracks come with a 6 month or 500 hour warranty.</span></span></em><br /><br /><br /><br /><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Calibri&quot;, &quot;sans-serif&quot;; color: black; font-size: 14pt; mso-bidi-font-size: 12.0pt; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-fareast-font-family: \'Times New Roman\';\"><strong>Range of Stock:</strong></span></span></p>\r\n<p>\r\n<p><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\">\r\n<p  style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-size: 12pt; mso-bidi-font-family: Calibri; mso-bidi-font-size: 11.0pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;\"><br />The Tuff-trac Morooka track range is available on indent for most models of tracked dumpers. Our supplier has a huge range of Morooka tracks to fit hundreds of makes and models.</span></p>\r\n</span></span><strong><span style=\"color: red;\"><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\"><br /><br /><br /></span></span></span></strong></p>\r\n</p>\r\n<p>\r\n<p><span style=\"mso-spacerun: yes;\">\r\n<p  style=\"margin: 0cm 0cm 0pt;\"><span style=\"font-size: 12pt; mso-bidi-font-family: Calibri; mso-bidi-font-size: 9.0pt; mso-bidi-theme-font: minor-latin;\"><span style=\"font-family: Calibri;\"><em>Our Morooka tracks have been proven in NZ conditions and we have many happy customers to date.</em></span></span><br /><br /><br /><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Calibri&quot;, &quot;sans-serif&quot;; color: black; font-size: 14pt; mso-bidi-font-size: 12.0pt; mso-ascii-theme-font: minor-latin; mso-hansi-theme-font: minor-latin; mso-bidi-font-family: \'Times New Roman\'; mso-fareast-font-family: \'Times New Roman\';\"><strong>Freight:</strong></span></span><br /></p>\r\n<br />Delivery times are usually 6 &ndash; 8 weeks from our supplier.</span></p>\r\n</p>\r\n<p>&nbsp;</p>\r\n<p>\r\n<p><strong><span style=\"font-family: Calibri; color: #ff0000; font-size: small;\"><span style=\"text-decoration: underline;\">The critical information required is as follows:</span></span></strong></p>\r\n<p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span style=\"color: red;\"><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\">&gt;&gt; Machine Make</span></span></span></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span style=\"color: red;\"><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\">&gt;&gt; Machine Model</span></span></span></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span style=\"color: red;\"><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\">&gt;&gt; Track Width in mm</span></span></span></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span style=\"color: red;\"><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\">&gt;&gt; Track Pitch in mm (centre to centre of drive links)</span></span></span></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong></strong></p>\r\n<p style=\"margin: 0cm 0cm 0pt;\"><strong><span style=\"color: red;\"><span style=\"font-size: small;\"><span style=\"font-family: Calibri;\">&gt;&gt; Number of drive links<br /><br /><br /><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Cambria&quot;, &quot;serif&quot;; font-size: 24pt; mso-bidi-font-size: 7.5pt; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\"><span style=\"color: #800080;\"><strong><em><span style=\"text-decoration: underline;\"><span style=\"font-family: &quot;Cambria&quot;, &quot;serif&quot;; font-size: 24pt; mso-bidi-font-size: 7.5pt; mso-ascii-theme-font: major-latin; mso-hansi-theme-font: major-latin;\"><span style=\"color: #800080;\"><a href=\"get-quote/\" title=\"Click Here For Quotation\">