order-top: windowtext; border-right: #e0dfe3;\"><span style=\"font-family: Calibri; font-size: small;\">310mm</span></td>\r\n</tr>\r\n<tr height=\"20\" style=\"height: 15pt;\">\r\n<td class=\"xl65\" height=\"20\" style=\"background-color: transparent; height: 15pt; border: #e0dfe3;\"><strong><span style=\"font-family: Calibri; font-size: small;\">Pin Diameter</span></strong></td>\r\n<td class=\"xl64\" style=\"border-bottom: windowtext 0.5pt solid; border-left: #e0dfe3; background-color: transparent; border-top: windowtext; border-right: #e0dfe3;\"><span style=\"font-family: Calibri; font-size: small;\">70mm</span></td>\r\n</tr>\r\n<tr height=\"22\" style=\"height: 17.1pt; mso-height-source: userset;\">\r\n<td class=\"xl65\" height=\"22\" style=\"background-color: transparent; height: 17.1pt; border: #e0dfe3;\"><strong><span style=\"font-family: Calibri; font-size: small;\">Colour</span></strong></td>\r\n<td class=\"xl64\" style=\"border-bottom: windowtext 0.5pt solid; border-left: #e0dfe3; background-color: transparent; border-top: windowtext; border-right: #e0dfe3;\"><span style=\"font-family: Calibri; font-size: small;\">Yellow</span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</p>\r\n<p>&nbsp;</p>',NULL,NULL,NULL,NULL,1,1,NULL,0,22,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,292,17,0,0,NULL),(325,'PartsPage','2010-11-30 03:17:35','2014-03-20 10:41:59','steel-wraps-cleaning-buckets','Steel Wraps - Cleaning Buckets',NULL,'<p>&nbsp;</p>\r\n<p>Sizes:&nbsp;&nbsp;1 x 1.2m,&nbsp;&nbsp;1 x 1.4m,&nbsp;&nbsp;6 x 1.5m,&nbsp; .&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</p>\r\n<p>Enquire today with your requirements</p>',NULL,NULL,NULL,NULL,1,1,NULL,0,24,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,292,20,0,0,NULL),(320,'PartsPage','2010-11-30 03:06:57','2014-03-20 10:41:59','steel-wraps-spade-buckets','Steel Wraps - Spade Buckets',NULL,'<p>&nbsp;</p>\r\n<p>Sizes are:</p>\r\n<p>1 x 200mm</p>\r\n<p>1 x 250mm</p>\r\n<p>3&nbsp;x 300mm</p>\r\n<p>9 x 350mm</p>\r\n<p>3 x 500mm</p>\r\n<p>1 x 600mm</p>\r\n<p>Enquire now with your requirements</p>',NULL,NULL,NULL,NULL,1,1,NULL,0,25,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,292,17,0,0,NULL),(294,'RedirectorPage','2010-10-07 08:22:15','2014-03-20 10:42:27','redirect-home','Redirect Home','HOME',NULL,NULL,'Top quality, efficient, friendly service. Quality rubber tracks at competitive prices backed up by an excellent manufacturers warranty and a large range of suppliers.',NULL,NULL,1,1,NULL,0,1,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,288,15,0,0,NULL),(280,'Page','2010-09-24 02:31:18','2014-03-20 10:42:27','about-us-track','About Us','ABOUT US','<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span><span style=\"color: #000000;\"><span><span style=\"color: #000000;\"><span><span style=\"text-decoration: underline;\"><strong><br /><img class=\"center\" src=\"assets/image-gallery/Photo-Gallery/mainline-track-premises/_resampled/ResizedImage600450-IMG1478.jpg\" width=\"600\" height=\"450\" alt=\"\" title=\"\" /><br /><br />Mainline Track</strong></span> is your only Tuff Part supplier in New Zealand for small to medium sized earthmoving machinery. We are a 100% NZ owned and operated company centrally located in Nelson. In late 2009 we started off selling a few second hand rubber tracks and a small range of new sizes. From there demand has continued to grow and we&rsquo;ve since picked up a very reliable supplier which is supplying us with top quality products which we are now selling all over New Zealand and up into the Pacific Islands. We now have numerous amounts of happy and repeat customers.</span></span></span></span><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><br /></span></span></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">In November 2012 Mainline Track opened its doors to a new premises and head office at 20A Poutama Street. The new building is the warehouse for the rubber tracks, excavator buckets and mini undercarriage parts. The well set up facility has a range of offices, a MAF approved transitional facility, plenty of parking for customers and space to load and unload trucks.</span></span></p>\r\n<p style=\"text-align: left;\">&nbsp;</p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">Product quality is top priority at <em><span style=\"font-family: Arial;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span style=\"text-decoration: underline;\"><a href=\"http://www.mainlinetrack.co.nz/\"><em><span style=\"font-family: Arial;\"><span style=\"font-family: \'Arial\',\'sans-serif\';\"><span style=\"text-decoration: underline;\">Mainline Track</span></span></span></em></a></span></span></span></em>. All our products are sourced from reputable companies worldwide, many of whom supply new excavator manufacturers. From our well stocked warehouse we are able to deliver anywhere in NZ, enabling our customers to have their machines ready for work with minimum delay and downtime.</span></span></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">We believe that technical support and product knowledge are our company\'s greatest strengths. With over 40 years&rsquo; experience in the earthmoving industry, you can be confident that our sales staff will advise which product is best suited to your requirements so that your machine can be returned to work without delay or undue expense.</span></span></span></span></p>\r\n<p style=\"text-align: left;\"><span style=\"color: #000000;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">If the parts you require are not in stock, we go to great lengths to find these parts for you. With many contacts in Australia and further afield, we can source parts we don&rsquo;t usually stock. This not only reduces the downtime of your machine, but gives you the confidence to rely on us as a one-stop-shop for all your mini excavator parts.</span></span></span></span></p>\r\n<h2 style=\"text-align: left;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span style=\"color: #000000;\">&ldquo;<span style=\"font-family: Arial;\"><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\">Our Mission&rdquo;</span></span> is to provide efficient personal service supplying quality products at competitive prices, supported by expert technical advice. We will continue to strengthen our reputation which is built on honesty, integrity &amp; excellent service&rdquo;<br /><br /><br /><span style=\"text-decoration: underline;\"><em>See below our current brochures:</em></span></span></span></span></span><span style=\"font-family: &quot;Arial&quot;,&quot;sans-serif&quot;; font-size: 9pt; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: EN-NZ;\"><span style=\"color: #000000;\"><span style=\"font-size: 9pt; font-family: &quot;Arial&quot;,&quot;sans-serif&quot;;\"><span style=\"color: #000000;\"><br /></span></span></span></span>\r\n<p style=\"line-height: 14.25pt; margin: 0cm 0cm 13.5pt; background: white;\"><br /><a href=\"assets/Uploads/Mainline-Track-Info/MainlineTrack-Leaflet.zip\" target=\"_blank\">Mainline Track Leaflet:</a></p>\r\n<p><a href=\"assets/Uploads/Mainline-Track-Info/Mainline-Track-Product-Cata.pdf\" target=\"_blank\">Mainline Product Catalogue:</a></p>\r\n<p>&nbsp;</p>\r\n<table border=\"0\">\r\n<tbody>\r\n<tr>\r\n<td><img class=\"left\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage158121-excavator-hd-sp1rocket.jpg\" width=\"158\" height=\"121\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"left\" src=\"assets/Uploads/Mainline-Track-Info/_resampled/ResizedImage159117-Rubber-tracks1c580fab.jpg\" width=\"159\" height=\"117\" alt=\"\" title=\"\" /></td>\r\n<td><img class=\"left\" src=\"assets/Uploads/Mainline-Track-Info/Rollers-Sprockets-Pin-Photos/_resampled/ResizedImage166123-track-roller-undercarriage-parts-excavator-parts.jpg\" width=\"166\" height=\"123\" alt=\"\" title=\"\" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</h2>',NULL,'We believe that technical support and product knowledge are our company\'s greatest strengths. With over 40 years experience in the earthmoving industry, you can be confident that our sales staff will advise which product is best suited to your requirem',NULL,NULL,1,1,NULL,0,2,NULL,1,0,NULL,NULL,'Inherit','Inherit',NULL,288,136,0,0,NULL),(282,'UserDefinedForm','2010-09-24 02:33:51','2014-03-20 10:45:03','contact-us-track','Contact Us','CONTACT US','<p><img class=\"right\" title=\"Mainline Tracks Building\" src=\"assets/Uploads/Mainline-Building.jpg\" alt=\"Mainline Tracks Building\" width=\"350\" height=\"223\"><strong>Mainline Track</strong><br> 20APoutama Street<br> Richmond<br> Nelson<br><br> Fax: 03 541 0787<br> NZ Freephone: 0800 551 201<br><br> Email: <a href=\"mailto:rubbertrack@mainlinecom.co.nz\">rubbertrack@mainlinecom.co.nz</a><br> Manager: Jason Smith</p>\n<hr><p><strong>Please enter your contact information:</strong><br>In order to respond to your request we need your contact information. Please complete the fields below. All fields marked with \"*\" are mandatory and must be filled in before your request can be processed.</p>',NULL,'Contact Mainline Track: NZ Freephone: 0800 551 201 - 20A Poutama Street, Richmond, Nelson',NULL,NULL,1,1,NULL,0,3,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,288,1,0,0,NULL),(288,'Page','2010-10-07 07:47:26','2014-03-20 10:42:27','sub-menu','Sub Menu',NULL,NULL,NULL,NULL,NULL,NULL,0,1,NULL,0,3,NULL,0,0,NULL,NULL,'Inherit','Inherit',NULL,0,7,0,0,NULL),(616,'Page','2013-02-01 16:40:48','2014-03-20 10:42:27','location','Location',NULL,'<p><iframe src=\"http://maps.google.co.nz/maps?f=q&amp;source=s_q&amp;hl=en&amp;geocode=&amp;q=Mainline+Track,+Poutama+Street,+Richmond&amp;aq=&amp;sll=-41.342173,173.171525&amp;sspn=0.002876,0.006968&amp;ie=UTF8&amp;hq=Mainline+Track,&amp;hnear=Poutama+St,+Richmond+7020&amp;t=m&amp;ll=-41.342101,173.169005&amp;spn=0.006444,0.013969&amp;z=13&amp;iwloc=A&amp;output=embed\" width=\"650\" height=\"400\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe><br /><a href=\"http://maps.google.co.nz/maps?f=q&amp;source=embed&amp;hl=en&amp;geocode=&amp;q=Mainline+Track,+Poutama+Street,+Richmond&amp;aq=&amp;sll=-41.342173,173.271525&amp;sspn=0.002876,0.006968&amp;ie=UTF8&amp;hq=Mainline+Track,&amp;hnear=Poutama+St,+Richmond+7020